import React, { Component } from "react";
import { Container } from "react-bootstrap";

class Cards extends Component {
  render() {
    return (
      <div>
        <Container>
          <Card
            md="auto"
            className="my-5 w-100 bg-primary rounded"
            style={{ height: "50rem" }}
          ></Card>
        </Container>
      </div>
    );
  }
}

export default Cards;
